import React from "react";
import { NavLink } from "react-router-dom";
import "./NavBar.css"

function NavBar({ dogs }) {
    return (
        <nav className="NavBar">
            <NavLink classNameto="/dogs">Home</NavLink>
            { dogs.map((dog, index) => (
                <NavLink key={ index } to={ `/dogs/${dog.name}` }>{ dog.name }</NavLink>
            )) }
        </nav>
    );
};

export default NavBar;
